  componentDidMount () {
    fetch('')
  }
  render () {
      return (
          <div className="App">
            <div id="filter-div">
              <button id="good-dog-filter">Filter good dogs: OFF</button>
            </div>
            <div id="dog-bar">
              <DogBar/>
            </div>
            <div id="dog-summary-container">
              <h1>DOGGO:</h1>
              <div id="dog-info">

              </div>
            </div>
          </div>
      )
  }
}

export default App;
